import { Routes, Route, Navigate     } from "react-router-dom";
import LoginPage from "../pages/LoginPage";

const privateRoute = ({children, ...rest}) => {
    const isAuthenticated = true;
    return !isAuthenticated? (
        <Routes>
            <Route {...rest} />
        </Routes>
    )
    : (
        redirect("/login")
    )
}

export default privateRoute
